pragma solidity ^0.8.0;



contract Auction{
    address payable public owner;
    uint public startBlock;
    uint public endBlock;
    uint256 public collectibleId;
   

    address payable[] public bidders;
    enum State {Started, Running, Ended, Cancelled}
    State public auctionState;
    
    uint public highestBindingBid;
    address payable public highestBidder;
    
    mapping(address => uint) public bids;
    
    uint bidIncrement;
    
    
    constructor(address payable creator, uint256 toknId){
        owner = creator;
        auctionState = State.Running;
        
        startBlock = block.number;
        collectibleId = toknId;
        bidIncrement = 10;
    }
    
    modifier notOwner(){
        require(msg.sender != owner);
        _;
    }
    
    modifier onlyOwner(){
        require(msg.sender == owner);
        _;
    }
    
    modifier afterStart(){
        require(block.number >= startBlock);
        _;
    }
    
    // modifier beforeEnd(){
    //     require(block.number <= endBlock);
    //     _;
    // }
    
    
    function min(uint a, uint b) pure internal returns (uint){
        if(a<b){
            return a;
        } else {
            return b;
        }
    }
    
    function cancelAuction() public onlyOwner{
        auctionState = State.Cancelled;
        for(uint i = 0; i <= bidders.length; ++i){
          
          bidders[i].transfer(bids[bidders[i]]);
        }

    }
    
    function placeBid() public payable notOwner afterStart returns(bool){
        require(auctionState == State.Running);
        require(msg.value > 0.001 ether);  
        if(bids[msg.sender] == 0){
          bidders.push(payable(msg.sender));
        }
        uint currentBid = bids[msg.sender] + msg.value;
        
        
        require(currentBid > highestBindingBid);
        
        bids[msg.sender] = currentBid;
        
        if(currentBid <= bids[highestBidder]) {
            highestBindingBid = min(currentBid + bidIncrement, bids[highestBidder]);
        } else {
            highestBindingBid = min(currentBid, bids[highestBidder] + bidIncrement);
            highestBidder = payable(msg.sender);
        }
        
        return true;
    }
    
    function finalizeAuction() public onlyOwner{
        require(auctionState != State.Cancelled);
        address payable recipient;
        uint value;
        
        
            
        recipient = owner;
        value = highestBindingBid;
        recipient.transfer(value);
        for(uint i = 0; i <= bidders.length; ++i){
          if(bidders[i] == highestBidder){
            recipient = highestBidder;
            value = bids[highestBidder] - highestBindingBid;
          }else{
            recipient = payable(msg.sender);
            value = bids[msg.sender];
          }
          recipient.transfer(value);
        }
        
        
        auctionState = State.Ended;
        endBlock = block.number;
        
    }
}
